import api from '../api/api';

import { GET_REPOSITORIES } from './repositories.conts';

export const getItem = () => {
    try {
        const response = api('https://api.github.com/repositories').then(res => {
            console.log("getItem -> res", res)
            return {
                type: GET_REPOSITORIES,
                payload: res
            };
        });
        //@ts-ignore
        // if (response.ok) {
